import './App.css';
import yellowDaisies from  './assets/img/yellow-daisies.png';

function App() {
  return (
    <div className="App">
      <header>
        <div className="intro">
          <h1>Yellow is a Happy Color</h1>
          <p>Yellow makes you feel happy and spontaneous.</p>
        </div>
      </header>

      <section>
        <div className="page2">
          <h2>Daisy Asteraceae</h2>
          <p>Yellow is perhaps the most energetic of the warm colors. It is associated with laughter, hope and sunshine.</p>
        </div>
        <img src="./assets/img/yellow-daisies.jpeg" />
      </section>
    </div>
  );
}

export default App;
